html{
    height: 100vh;
    margin: 0;
    padding: 0;
}

body{
    display: grid;
    grid-template-rows: min-content min-content auto min-content;
    grid-template-areas:
    "navigation"
    "header"
    "content"
    "footer";
    margin: 0;
    padding: 0;
    perspective: 1px;
    transform-style: preserve-3d;
    overflow-y: scroll;
    overflow-x: hidden;
    min-height: 100vh;
    font-family: 'Great Vibes', cursive;
    background-color: rgba(172, 155, 119, 0.678);
}

#contact ul {
    display: inline-flex;
    top: 0;
    left: 0;
    align-content: space-between;
    justify-content: flex-start;
    list-style: none;
    font-size: 20px;
}
a {
    text-decoration: none;
    color: rgba(59, 16, 16, 0.781);
}

#navigation{
    grid-area: navigation;
    display: block;
    font-size: 25px;
    list-style: none;
}

#navigation li {
    font-family: 'Indie Flower', cursive;

}

#header{
    grid-area: header;
    display: block;
    text-align: right;
}

#content {  
    grid-area: content;
    letter-spacing: 2px;
}

.quote {
    text-align:  center;
    padding-top: 25px;
}

.parallax{
    position: relative;
    min-height: 100%;
    width: 100%;
    padding: 25% 10%;
    box-sizing: border-box;
    box-shadow: 0 -1px 10px rgba(0, 0, 0, .7);
    transform-style: inherit; 
}   

.parallax:before {
    content: "";
    position: absolute;
    top:0;
    bottom: 0;
    left: 0;
    right: 0;
    box-shadow: 0 0 8px 1px rgba(0, 0, 0, .7);
}
    
.parallax, .parallax:before {
    /*background-size: cover; */
    background-repeat: no-repeat;
    background-attachment: fixed;
    background-position: center;
}

